How to maintain bronzy, glowing skin all through the colder months. 👇🏼

I know it’s still summer… but once school starts i feel like everything speeds up… do you feel the same?

During the summer it’s easy to have that sun kissed glow (a lot of time outside with some light perspiration 😅) but as we get into the fall and winter it can be tricky achieving that summer glow. So I’ve put together a easy list of items that make the look effortless:
@saiebeauty slip tint, sun melt, mascara in brown and dew blush
@code.mint.beauty pressed powder 
@lauramercier caviar stick
@makebeautyofficial cream supreme high impact lipstick 
@morphebrushes prep&set mist

Do you like to hang family photos or art on your walls? Can you believe we didn’t have a single picture frame in our house for over a year?! I just added the floating frames from @artifactuprising and I’m so happy with how it looks. {here’s a code for the site if you’d like one: ANDREEA15}

As we freeze these precious memories in frames, it’s a reminder of time with our little girl that is so cherished. 🤗💕 Share with me your most treasured family memory in the comments below! 👇✨

 #FamilyLove #CherishTheMoments #CreatingMemories
